import { Link } from "react-router-dom";
import EventItem from "../components/EventItem";

const Events = () => {
  return (
    <>
      <h1>Events</h1>
      <ul>
        <li>
          <Link to={`e1`}>
            <p>e1</p>
          </Link>
        </li>
        <li>
          <Link to="{`e2`}"></Link>
        </li>
        <li>
          <Link to="{`e3`}"></Link>
        </li>
      </ul>
    </>
  );
};

export default Events;
